                <div className="address">
                    Address
                    <p>"Mauli children hospital &amp; Aesthetic Dental clinic, Shop no 30/31, 1st floor,  Amarante Chs,  sector 9E , near D mart, kalamboli Raigad"</p>
                </div>
                <ul className="navs">
                   <li>Home</li> 
                   <li>Services</li> 
                   <li></li> 
